import React, { useState, useEffect } from 'react';
import DoctorNavbar from '../../components/DoctorNavbar';
import DoctorFooter from '../../components/DoctorFooter';
import { Link, useParams } from 'react-router-dom';
import DoctorCalendar from '../../components/DoctorCalendar';
import "../Calendar.css";


const ManageAppointments = () => {
  const { patientUserId } = useParams();

  const [appointments, setAppointments] = useState([
    {
      title: '',
      clinic: '',
      address: '',
      patientUserId: '',
      start: new Date(),
      end: new Date(),  // 5:00 PM
      appointmentId: '',
      appointmentStatus: '',
      slots: ''
    },
  ]);



  useEffect(() => {
    // Replace 'http://localhost:8080' with your actual API URL
    fetch(`http://localhost:8080/appointments?patientUserId=${patientUserId}`)  // Assuming you already have the patientUserId
      .then((appointmentsResponse) => {
        if (appointmentsResponse.ok) {
          return appointmentsResponse.json();
        }
        throw new Error('Network response was not ok');
      })
      .then((appointmentsData) => {
        const formattedAppointments = appointmentsData.map((appointment) => {
          // Extract date and time components
          const [year, month, day] = appointment.scheduleDate.split('-').map(Number);
          const [hours, minutes] = appointment.startTime.split(':').map(Number);
          const [hours2, minutes2] = appointment.endTime.split(':').map(Number);

          // Create Date objects for start and end times
          const startDate = new Date(year, month - 1, day, hours, minutes);
          const endDate = new Date(year, month - 1, day, hours2, minutes2);

          // Create an appointment object
          return {
            title: appointment.patientName,
            clinic: appointment.clinicName,
            address: appointment.address,
            patientUserId: appointment.patientUserId,
            start: startDate,
            end: endDate,
            appointmentId: appointment.transactionNo,
            appointmentStatus: appointment.status,
            slots: appointment.slots


          };
        });

        setAppointments(formattedAppointments);
      })
      .catch((error) => {
        // Handle errors
        console.error(error);
      });
  }, []);


  return (
    <div>
    <DoctorNavbar />
    <div style={{ display: "flex", margin: "auto", width: "100vw", justifyContent: "center" }}>
        <DoctorCalendar />

        <div style={{ marginLeft: "30px" }}>
          <h1>My Clinic</h1>
          <table>
            <tr>
              <td style={{width: "600", marginRight: "10px", fontSize:"20px"}}><b>Juan Santos Santiago</b></td>
              <td><Link to="/viewprofile"><button style={{borderRadius: 0, padding: 10, marginLeft: "10px", width:"100%"}}>View Profile</button></Link></td>
            </tr>
            <br />
            <tr>
                <td rowSpan={2}>11/06/2023 MONDAY <br/> 2:00-5:00 PM <br/> SLOT #1 <br/> <u><a href='#'>Move slot number</a></u></td>
                <td><Link to="/docresched"><button style={{borderRadius: 0, padding: 10, marginLeft: "10px", width:"100%", height:"45px"}}>Reschedule Appointment</button></Link></td>
            </tr>
            <tr>
                <td><button className='cancel' style={{padding: 10, marginLeft: "10px"}}>Cancel Appointment</button></td>
            </tr>
            <br/>
            <tr><td colSpan={2}><a href='#' style={{fontSize: "18px"}}><i>View Appointment History</i></a></td></tr>
          </table>
        </div>
      </div>
    <DoctorFooter />
    </div>
  )
};

export default ManageAppointments
